  false,\n\t\"url\": null,\n\t\"notes\": \"Data contains two versions of a Long Island
  Sound Data Set collectednbetween August 9-14, 1971. Data was originally collected
  by SUNY atnStony Brook and automated by SCI, Inc. This data was obtained from SCI.n53
  stations were sampled for chlorophyll, oxygen, nitrate, nitrite,nphosphate, ammonia,
  and urea. Additionally, physical parameters such asntemperature, salinity, density,
  transmissivity, and current velocitynwere included. The report prepared by C.C.
  Hardy, 1972 entitledn\"MOVEMENT AND QUALITY OF LONG ISLAND SOUND WATERS 1971\",
  Marine SciencesnResearch Center, SUNY at Stony Brook, Technical Report #17 providesndocumentation
  regarding the data format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
